import React from "react";
import { InputText } from "primereact/inputtext";
import Button1 from "../../../components/Button1";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";

const Newsletter = () => {
  return (
    <section className="">
      <div>
        <h1 className="">
          <span className="">Join in and get </span>
          <span className="">25% OFF!</span>
        </h1>
        <p>Subscribe to our newsletter and get 25% OFF discount code</p>
      </div>
      <div className="flex items-center space-x-4">
        <div className="relative w-full md:w-96">
          <FontAwesomeIcon icon={faEnvelope} className="" />
          <InputText
            type="text"
            className="rounded-full py-3 px-4 shadow-md w-full md:w-96"
            placeholder="Email address"
          />
        </div>
        <Button1 label="Subscribe" />
      </div>
    </section>
  );
};

export default Newsletter;
